import React from 'react'
import { UploadPage } from './UploadPage'

export const MainPage = () => {
    function toUploadPage(toUploadPage) {
        if (toUploadPage == true) {
            return (<UploadPage />);
        } else {
            return (<MainPage />);
        }
    }
  return (
    <div>
    <div>this is my main page to upload wav file!</div>
    <button onClick={toUploadPage(true)}>click my to upload your files!</button>
    
    </div>
    

  )
}
